export default (function(a){return {data:{mUTIxwLPIz:{data:{id:1179,attributes:{imdbId:"tt0067116",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BOTZhY2E3NmItMGIwNi00OTA2LThkYmEtODFiZTM0NGI0ZWU5XkEyXkFqcGdeQXVyNTc1NTQxODI@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.7\u002F10"},{Source:"Rotten Tomatoes",Value:"98%"},{Source:"Metacritic",Value:"94\u002F100"}],item_lang:{data:{id:1842,attributes:{title:a,plot:"William Friedkin's gritty police drama portrays two tough New York City cops trying to intercept a huge heroin shipment coming from France. An interesting contrast is established between 'Popeye' Doyle, a short-tempered alcoholic bigot who is nevertheless a hard-working and dedicated police officer, and his nemesis Alain Charnier, a suave and urbane gentleman who is nevertheless a criminal and one of the largest drug suppliers of pure heroin to North America. During the surveillance and eventual bust, Friedkin provides one of the most gripping and memorable car chase sequences ever filmed.",slug:"the-french-connection"}}},books:{data:[{id:6611,attributes:{title:a,description:"Details the efforts of more than three hundred law enforcement officials--including NYPD detectives Eddie \"Popeye\" Egan and his partner Sonny Grosso--from all different levels of government to stop 112 pounds of heroine from hitting the streets of New York in one of the most remarkable cases in history.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=S52AtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Robin Moore"],firstBook:true,published:"2003-09-01",publisher:"Lyons Press",subtitle:"A True Account of Cops, Narcotics, and International Conspiracy"}}]}}},meta:{}}},prerenderedAt:1680940973625}}("The French Connection"))